const mesto = 'mesto';
const map = 'map';
const mc = 'mestska-cast';
const vo = 'vo';

const data = []
const L = {
	marker: function([lat, long], options){
		this.data = {lat, long}
		return this
	},
	bindPopup: function(html){
    this.data.kod_obce = html.match(/kod_obce=(\d*)/)[1]
    this.data.name = cheerio('.hlavicka', html).text()
		return this
	},
	addTo: function(map){
		data.push(this.data)
		return this
	}
}

